                const {data} = await axios.get('/api/products')
                setProduct(data)
              }
              fetchProduct()
	},[])
  return (
    <div>
      <div className="row center">
      {products.map(product => (
				<Product product={product}/>
				))}
<Hello/>
      </div>
    </div>
  );
}
export default HomeScreen
